USE gallery_db;

CREATE TABLE pieces (
  id int(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
  itemId varchar(40),
  thumb varchar(50),
  name varchar(150),
  artist varchar(50),
  type ENUM('REALISM','HYPERREALISM','SURREALISM','IMPRESSIONISM','EXPRESSIONISM','ABSTRACT-ART','POP-ART','CUBISM','PORTRAIT','GENDER-PAINTING','LANDSCAPE','STILL-LIFE','NAKED','HISTORICAL-PAINTING','OIL','WAX','WATERCOLOR','TEMPERA','ACRYLIC','PIE','QUENCHING','INK','COOL','GRISALEA','POINTILLISM','DRIPPING','GRAFFITI','MIXED-MEDIA','ON-WOODEN-BOARD','ON-CANVAS','IN-COPPER','IN-GLASS','ON-PAPER','SCULPTURE','ABSTRACT-SCULPTURE','RELIEF','COLOR-RELIEF','GLASS-RELIEF','CONTEMPORARY','ROUND-BULK-STATUE','LOW-RELIEF','BUST','TORSO','KINETIC-SCULPTURE','CHRYSELEPHANTINE','ARCHITECTURAL-SCULPTURE','CLAY-SCULPTURE','STONE-SCULPTURE','STUCCO-SCULPTURE','METAL-SCULPTURE','WOOD-SCULPTURE','IVORY-SCULPTURE','CONCRETE-SCULPTURE','EMPTYING','REMOVING','ADDING') DEFAULT 'OIL',
  release_date date ,
  size varchar(50),
  price decimal(5,1),
  currency varchar(50),
  INDEX pieces_index (id, release_date)
);

